import React,{useState, useEffect} from "react";
import  ReactDOM  from "react-dom";

function Todo(){
    const [error, setError] = useState(null);
    const[isLoaded,setIsLoaded] = useState(false);
    const [todoList, setTodoList] = useState([])

useEffect(() =>{
    fetch("/api/get-all")
    .then(res => res.json())
    .then(
        (result) =>{
            setIsLoaded(true);
            setTodoList(result)
        },
        (error) =>{
          setIsLoaded(true);
          setError(error);  
        }
    )
}, [] )
    if(error){
        return
        <div>
            error
        </div>
    }else if(!isLoaded){
        return
        <div>
            Loading.... 
        </div>
    }else{
        return(
            <ul>
                {todoList.map(todo =>(
                    <li>
                    

                    {todo.entry} {todo.date}{(todo.precedence)}


                    </li>
                ))}
            </ul>
        )
    }
}
export default Todo;
